import React from 'react';
import Particles from 'react-particles-js';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import './App.css';

const particlesOptions ={
  particles: {
    number: {
      value: 80,
      density: {
        enable: true,
        value_area: 800
      }
    },
    color:{
      value: '#ffff07'
    },
    shape:{
      type:'star'
    },
    size: {
      value: 3
    },
    line_linked: {
      enable: true,
      distance: 150,
      color: "#2f11f2",
      opacity: 0.4,
      width: 1
    }
  },
  interactivity:{
    detect_on: 'window',
    events:{
      onhover:{
        enable:true,
        mode: 'repulse'
      },
      resize: true
    }
  },
  modes:{
    repulse:{
      distance:100,
      duration: 0.4
    }
  },
  retina_detect:true
}

function App() {
  return (
    <div className="App">
      <Particles className= 'particles'
        params={particlesOptions} 
      />
      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm />
      {/*<FaceRecogniction />*/}
    </div>
  );
}

export default App;
